import React from 'react';
import axios from "axios";

export default class ArchivePage extends React.Component{
    constructor(props){
        super(props);
        this.state = {
            archives:[],
            archiveId:'',
        };
    }

    handleGetArchiveInputChange = e => {
        this.setState({
          [e.target.name]: e.target.value,
        });
    };

    handleGetArchiveSubmit = e => {
    e.preventDefault();

    const archiveId  = this.state.archiveId;
    alert(archiveId);


    axios
      .post('http://localhost:3001/getArchive', archiveId)
      .then(() => console.log('GET ARCHIVE'))
      .catch(err => {
        console.error(err);
      });
  };

    componentDidMount() {
        fetch('/listarchives')
          .then(response => response.json())
          .then(json => this.setState({ archives: json }));
      }


    render() {
        return(
            <div>
                <h1>Past Archives: </h1>
                <p></p>
                <form action="http://localhost:3001/deletearchive" method="POST">
                        <h5>Delete Archive:  </h5>
                        <input type="deleteArchive" name = "deleteArchive" placeholder="Enter Archive ID: " id ="deleteArchive" required></input>
                        <input type="submit" value="Delete Archive"></input>
                </form>
                <p></p>
                {
                this.state.archives.length === 0
                    ? 'Loading users...'
                    : 
                    this.state.archives.map(archive => (
                        <table class="table table-striped">

                            <tbody>
                                <tr>
                                    <td><b>Name: </b>{archive.name || "Untitled"}</td>
                                    <td><b>Time: </b>{archive.duration} seconds</td>
                                    <td><b>Status: </b>{archive.status}</td>
                                    <td><b>Archive ID: </b> {archive.id}</td>
                                    {archive.status === 'available'?
                                    <td><b>URL: </b><a href={archive.url}>Archive Link</a></td>
                                    :
                                    <td><b>URL: </b>Link Not Available</td>
                                    }


                                </tr>
                            </tbody>
                        </table>

                    ))
                }

            </div>
        )
    };
};
